import React from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../components/Header'; 

function Home() {
  return (
    <div>
      <Header />
      <div className="content">
        <h1>Главная страница</h1>
      </div>
    </div>
  );
}

export default Home;
